import { BrowserRouter } from "react-router-dom";
import "./App.css";
import AppRouter from "./components/AppRouter";
import Header from "./components/Header/Header";

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Header />
        <div className="container">

        </div>
        <AppRouter />
      </BrowserRouter>
    </div>
  );
};

export default App;
